GpuAsyncWaiter::GpuAsyncWaiter(Gpu* proxy)
    : proxy_(proxy)
{
}

GpuAsyncWaiter::~GpuAsyncWaiter() = default;

void GpuAsyncWaiter::EstablishGpuChannel(int32_t* out_client_id, ::mojo::ScopedMessagePipeHandle* out_channel_handle, ::gpu::GPUInfo* out_gpu_info,
    ::gpu::GpuFeatureInfo* out_gpu_feature_info, ::gpu::SharedImageCapabilities* out_shared_image_capabilities)
{
    base::RunLoop loop;
    proxy_->EstablishGpuChannel(base::BindOnce(
        [](base::RunLoop* loop, int32_t* out_client_id, ::mojo::ScopedMessagePipeHandle* out_channel_handle, ::gpu::GPUInfo* out_gpu_info,
            ::gpu::GpuFeatureInfo* out_gpu_feature_info, ::gpu::SharedImageCapabilities* out_shared_image_capabilities, int32_t client_id,
            ::mojo::ScopedMessagePipeHandle channel_handle, const ::gpu::GPUInfo& gpu_info, const ::gpu::GpuFeatureInfo& gpu_feature_info,
            const ::gpu::SharedImageCapabilities& shared_image_capabilities) {
            *out_client_id = std::move(client_id);
            *out_channel_handle = std::move(channel_handle);
            *out_gpu_info = std::move(gpu_info);
            *out_gpu_feature_info = std::move(gpu_feature_info);
            *out_shared_image_capabilities = std::move(shared_image_capabilities);
            loop->Quit();
        },
        &loop, out_client_id, out_channel_handle, out_gpu_info, out_gpu_feature_info, out_shared_image_capabilities));
    loop.Run();
}

